"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[866],{4612:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2024/08/08/winners","metadata":{"permalink":"/blog/2024/08/08/winners","source":"@site/blog/2024-08-08-winners.md","title":"Sieger Heidelbergman 2024","description":"Race","date":"2024-08-08T00:00:00.000Z","formattedDate":"8. August 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Sieger Heidelbergman 2024","authors":["orga"]},"unlisted":false,"nextItem":{"title":"Strecken-Sperrungen","permalink":"/blog/2024/07/25/"}},"content":"![Race](/blog/blog_winner01.jpg)\\n\\nUnsere HeidelbergWOMAN und unser HeidelbergMAN 2024: Valerie Moser und Gregor Payet  \ud83d\udc51\\n\\nValerie von den Karlsruher Lemmingen hat die anspruchsvolle Strecke am Sonntag in verdammt schnellen 2 Stunden, 16 Minuten und 51 Sekunden hinter sich gebracht \u26a1\ufe0f\\n\\nDas Frauenpodium wurde durch Laura Jan\xdfen (Team Nikar Heidelberg, 2:17:47) und Ursula Tr\xfctzschler (Team Nikar Heidelberg, 2:19:17) vervollst\xe4ndigt. \\n\\nGregor startet ebenfalls f\xfcr das Team Nikar Heidelberg und ist mit einer Wettkampfzeit von 1 Stunde, 56 Minuten und 45 Sekunden einer der wenigen Athleten, die den HeidelbergMan in unter 2 Stunden bew\xe4ltigt haben \ud83d\udd25 \\n\\nDas M\xe4nnerpodium komplettierten Jakob Breinlinger (Team Nikar Heidelberg, 1:58:39) und Jannik Stoll (Skin Fit Racing Team, 2:00:14). \\n\\nWir gratulieren euch von ganzem Herzen zu euren Wahnsinnsleistungen und hoffen euch bald wieder bei unserem Wettkampf begr\xfc\xdfen zu d\xfcrfen \u2764\ufe0f\\n\\n![Siegering](/blog/blog_winner02.jpg)\\n\\n![Sieger](/blog/blog_winner03.jpg)\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Vielen Dank auch an aller Teilnehmer, Helfer, Sponoren, Zuschauer, ....\\nvielen, vielen Dank an euch alle! Ohne euch w\xe4re der ganze Tag nicht nur ein halb so sch\xf6nes Erlebnis geworden, es w\xe4re uns auch niemals gelungen den HeidelbergMAN \xfcberhaupt zur\xfcck zu bringen. \ud83e\udd73\\n\\nUnd auch Gratulation an David Breinlinger - der schnellste Mann am Tag des HeidelbergMan 2024 \ud83d\udd25 \\n\\n\ud83d\udd25 RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg"},{"id":"/2024/07/25/","metadata":{"permalink":"/blog/2024/07/25/","source":"@site/blog/2024-07-25.md","title":"Strecken-Sperrungen","description":"Liebe Athleten, liebe Zuschauer, liebe Anwohner,","date":"2024-07-25T00:00:00.000Z","formattedDate":"25. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Strecken-Sperrungen","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Sieger Heidelbergman 2024","permalink":"/blog/2024/08/08/winners"},"nextItem":{"title":"Finisher Shirt 2024","permalink":"/blog/2024/07/08/TShirt"}},"content":"Liebe Athleten, liebe Zuschauer, liebe Anwohner,\\n\\nam Sonntag, den 28.07.2024, findet der 30. Heidelbergman statt. Wir freuen uns auf ein gro\xdfes Event und viele Zuschauer. Damit der Wettkampf f\xfcr alle Beteiligten reibungslos abl\xe4uft, bitten wir um Verst\xe4ndnis f\xfcr die notwendigen Strecken-Sperrungen.\\n\\nDie Strecken-Sperrungen sind wie folgt:\\n\\n![Strecken-Sperrungen-Schwimmen](/blog/sperrung_schwimmen.webp)\\n\\n![Strecken-Sperrungen-Radfahren](/blog/sperrung_rad.webp)\\n\\n![Strecken-Sperrungen-Laufstrecke](/blog/sperrung_laufen.webp)\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch!\\n\\n\ud83d\udd25RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg \\n\\n\ud83d\ude80Feiert mit uns das 30. JUBIL\xc4UM\ud83d\ude80"},{"id":"/2024/07/08/TShirt","metadata":{"permalink":"/blog/2024/07/08/TShirt","source":"@site/blog/2024-07-08-TShirt.md","title":"Finisher Shirt 2024","description":"Staffel","date":"2024-07-08T00:00:00.000Z","formattedDate":"8. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Finisher Shirt 2024","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Strecken-Sperrungen","permalink":"/blog/2024/07/25/"},"nextItem":{"title":"Pasta-Party","permalink":"/blog/2024/07/04/pasta"}},"content":"![Staffel](/blog/hdman24_shirt.jpg)\\n\\n\ud83d\udd25Finisher Shirt 2024\ud83d\udd25\\n\\nGemeinsam mit unserem Partner @yellowgreenteam haben wir das diesj\xe4hrige HDMan Finisher Shirt in der Jubil\xe4ums Edition designed.\ud83d\udd25\\n\\nZur Bestellung geht es hier: [Finisher Shirt 2024](https://yellowgreen.de/Teilnehmershirt-zum-HEIDELBERGMAN-2024/HDman2024Shirt)\\n\\nEs handelt sich um ein Unisex Sportshirt und kommt als slimfit Version. Es besteht aus zwei hochwertigen Funktionsstoffen. Die Front ist aus einem Polyestergewebe mit Microl\xf6chern gefertigt, der R\xfccken aus einem Polyestergewebe mit einer Meshstruktur zum besseren Feuchtigkeitstransport.\ud83d\udca7\ud83d\udca6\\n\\nDas Shirt hat ein Nackenband und enger geschnittene \xc4rmel.  Eine Gr\xf6\xdfentabelle findet ihr auf der Website von Yellogreen.\\nDie Rohstoffe wurden in der EU produziert und das Textil in der EU gefertigt. \ud83c\uddea\ud83c\uddfa\\n\\nEs besteht die M\xf6glichkeit, das Shirt im Vorverkauf mit dem Namen bedrucken zu lassen. \\nMaterial: 100% Polyester, Made in EU\\n\\nDas Teilnehmershirt kostet im Vorverkauf 25,- Euro und am Veranstaltungstag 30,- Euro. (So lange der Vorrat reicht). Das im Vorverkauf erworbene Shirt kann am Veranstaltungstag an unserem Verkaufsstand zusammen mit der Rechnung abgeholt werden. \\n\\nSchnell sein lohnt sich! \ud83d\ude80\\n\\n\ud83d\udd25 RACE DAY: 28.07.2024 \ud83d\udd25\\n\\n\ud83d\udccd Heidelberg\\n\\n\ud83d\ude80 Feiert mit uns das 30. JUBIL\xc4UM \ud83d\ude80"},{"id":"/2024/07/04/pasta","metadata":{"permalink":"/blog/2024/07/04/pasta","source":"@site/blog/2024-07-04-pasta.md","title":"Pasta-Party","description":"Staffel","date":"2024-07-04T00:00:00.000Z","formattedDate":"4. Juli 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Pasta-Party","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Finisher Shirt 2024","permalink":"/blog/2024/07/08/TShirt"},"nextItem":{"title":"Jetzt noch 30 Startpl\xe4tze sichern!","permalink":"/blog/2024/06/19/"}},"content":"![Staffel](/img/banner/Laufen.png)\\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d **Pasta-Party unterst\xfctzt von FALK** \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 Am 27.07. um 18:00 Uhr findet die Pasta-Party f\xfcr alle Teilnehmer des Heidelbergman Triathlons statt. \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nDen Anmeldelink f\xfcr die Pasta-Party findet ihr hier: [Anmeldung Pasta-Party](https://forms.office.com/r/3mbpLwkAvu)\\n\\nVielen Dank an FALK f\xfcr die Unterst\xfctzung bei der Pasta-Party! \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 \\\\\\nDatum: 27.07.2024 \\\\\\nZeit: 18:00 Uhr \\\\\\nOrt: Neckarwiese, Heidelberg \\\\\\n\\nFreut Euch auf: \\\\\\nLeckere Pasta-Variationen \\\\\\nErfrischende Getr\xe4nke \\\\\\nEine entspannte Atmosph\xe4re zum Austausch mit anderen Teilnehmern \\\\\\nMotivation und Tipps von erfahrenen Athlet:innen \\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d \\\\\\nKosten: \\\\\\nF\xfcr Helfer:innen: Kostenlos \\\\\\nF\xfcr Triathlet:innen: 2\u20ac pro Portion\\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\nDie Pastaparty ist die perfekte Gelegenheit, um sich gemeinsam auf den kommenden Wettkampf einzustimmen und sich mit Gleichgesinnten auszutauschen.\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nPS: Ihr k\xf6nnt gerne Freunde und Familie mitbringen!\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch! \ud83c\udf89\ud83c\udf89\ud83c\udf89\\n\\n![FALK](/img/sponsor/main/falk2019.jpg)"},{"id":"/2024/06/19/","metadata":{"permalink":"/blog/2024/06/19/","source":"@site/blog/2024-06-19.md","title":"Jetzt noch 30 Startpl\xe4tze sichern!","description":"Staffel","date":"2024-06-19T00:00:00.000Z","formattedDate":"19. Juni 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Jetzt noch 30 Startpl\xe4tze sichern!","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Pasta-Party","permalink":"/blog/2024/07/04/pasta"},"nextItem":{"title":"Radstrecken-Checks f\xfcr den Heidelbergman Triathlon","permalink":"/blog/2024/06/04/"}},"content":"![Staffel](/img/banner/Staffel.jpg)\\n\\n*\ud83e\udd73 WIR WAREN AUSGEBUCHT! \ud83e\udd73 ABER ZUM 30. JUBIL\xc4UM DES HEIDELBERGMAN GEBEN WIR NOCH 30 ZUS\xc4TZLICHE STARTPL\xc4TZE FREI!* \ud83c\udf89\\n\\n\ud83d\udcc5 Am voraussichtlichen 22.06. um 10:00 werden 30 weitere Startpl\xe4tze f\xfcr den Heidelbergman Triathlon verf\xfcgbar sein. Da wir die Pl\xe4tze urspr\xfcnglich f\xfcr Staffeln vorgesehen hatten, wird es leider eine kleine Preiserh\xf6hung geben. \ud83e\udd11 \ud83d\udea8\\n\\n\\n\ud83d\udd25 Schnell sein lohnt sich! Sichert euch jetzt die letzten Startpl\xe4tze f\xfcr den Heidelbergman Triathlon und seid dabei, wenn wir gemeinsam die Ziellinie \xfcberqueren! \ud83c\udfca\ud83c\udffb\ud83d\udeb4\ud83c\udffd\u200d\u2642\ufe0f\ud83c\udfc3\ud83c\udffc\u200d\u2640\ufe0f\\n\\n\ud83c\udfc6 Die Pl\xe4tze sind begrenzt und sie werden schnell vergeben sein. Seid dabei und erlebt ein unvergessliches Rennen! \ud83c\udfc1\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch!\\n\\n\ud83d\udd25RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg \\n\\n\ud83d\ude80Feiert mit uns das 30. JUBIL\xc4UM\ud83d\ude80"},{"id":"/2024/06/04/","metadata":{"permalink":"/blog/2024/06/04/","source":"@site/blog/2024-06-04.md","title":"Radstrecken-Checks f\xfcr den Heidelbergman Triathlon","description":"Staffel","date":"2024-06-04T00:00:00.000Z","formattedDate":"4. Juni 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Radstrecken-Checks f\xfcr den Heidelbergman Triathlon","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Jetzt noch 30 Startpl\xe4tze sichern!","permalink":"/blog/2024/06/19/"},"nextItem":{"title":"Einzelanmelung voll","permalink":"/blog/2024/06/03/"}},"content":"![Staffel](/img/banner/Anfahrt.png)\\n\\n\\n\ud83d\udeb4\u200d\u2640\ufe0f **Heidelbergman Triathlon: Bereit f\xfcr den Streckencheck?** \ud83d\udeb4\u200d\u2642\ufe0f\\n\\nLiebe Triathlon-Community,\\n\\nder Countdown f\xfcr den Heidelbergman Triathlon l\xe4uft! Um euch optimal vorzubereiten, bieten wir euch zwei exklusive Radstrecken-Checks an. Hier sind die Details:\\n\\n---\\n\\n\ud83d\udcc5 **09.06.2024 \u2013 Frauen Streckencheck mit den Whatsuppgirls**\\n\\n\ud83c\udf1f Ladies, dieser Tag geh\xf6rt euch! Schlie\xdft euch den Whatsuppgirls an und erlebt die Radstrecke des Heidelbergman Triathlons aus erster Hand. Perfekt, um sich in einer unterst\xfctzenden und motivierenden Atmosph\xe4re auszutauschen und zu trainieren.\\n\\n\ud83d\udd52 Zeit: 9:00 Uhr \\\\\\n\ud83d\udccd Treffpunkt: OK Kool, Wallstra\xdfe 3, Wieblingen, Heidelberg \\\\\\n\ud83d\udeb4\u200d\u2640\ufe0f Zielgruppe: Alle Frauen, unabh\xe4ngig vom Leistungsniveau \\\\\\n\ud83d\udda5\ufe0f Anmelde-Link: https://form.jotform.com/240683835915364\\n\\n---\\n\\n\ud83d\udcc5 **14.06.2024 \u2013 Streckencheck f\xfcr alle mit Kickass**\\n\\n\ud83c\udf1f Dieser Streckencheck ist f\xfcr alle offen! Gemeinsam mit dem Kickass-Team erkunden wir die Radstrecke und bereiten uns auf die Herausforderungen des Rennens vor. Eine gro\xdfartige Gelegenheit, um Tipps und Tricks von erfahrenen Athleten zu erhalten und die Strecke besser kennenzulernen.\\n\\n\ud83d\udd52 Zeit: 17:30 Uhr \\\\\\n\ud83d\udccd Treffpunkt: KickAss, Handschuhsheim, Heidelberg \\\\\\n\ud83d\udeb4\u200d\u2642\ufe0f Zielgruppe: Alle Athleten, egal ob Anf\xe4nger oder Profi \\n\\n---\\n\\n**Warum teilnehmen?**\\n\\n\ud83d\udd0d Streckenkenntnis: Vertrautheit mit der Strecke kann entscheidend sein. Ihr lernt nicht nur die T\xfccken und Herausforderungen der Radstrecke kennen, sondern k\xf6nnt auch strategisch planen.\\n\\n\ud83e\udd1d Gemeinschaft: Nutzt die Gelegenheit, euch mit anderen Athleten auszutauschen, euch gegenseitig zu motivieren und wertvolle Tipps zu erhalten.\\n\\n\ud83d\udcaa Training: Perfekt, um eure Trainingseinheiten zu erg\xe4nzen und die eigene Performance zu verbessern.\\n\\nWir freuen uns darauf, euch bei den Streckenchecks zu sehen und gemeinsam die letzten Vorbereitungen f\xfcr den Heidelbergman Triathlon zu treffen. Lasst uns zusammen stark sein und dieses Rennen rocken!\\n\\n#Heidelbergman #TriathlonTraining #Streckencheck #Whatsuppgirls #Kickass #TriathlonCommunity #BikeTraining #Frauenpower\\n\\n**Tipps f\xfcr den Streckencheck:**\\n\\nCheckt euer Bike \u2013 Stellt sicher, dass euer Fahrrad in einwandfreiem Zustand ist. \\\\\\nPackt ausreichend Wasser und Snacks ein \u2013 Haltet euch w\xe4hrend des Checks gut hydriert und energiereich.\\\\\\nTragt passende Kleidung und Helm \u2013 Sicherheit geht vor!\\\\\\nSeid p\xfcnktlich \u2013 So k\xf6nnen wir gemeinsam starten und die Strecke optimal nutzen.\\n\\n\\nWir sehen uns auf der Strecke! \ud83d\udeb4\u200d\u2640\ufe0f\ud83d\udeb4\u200d\u2642\ufe0f"},{"id":"/2024/06/03/","metadata":{"permalink":"/blog/2024/06/03/","source":"@site/blog/2024-06-03.md","title":"Einzelanmelung voll","description":"Staffel","date":"2024-06-03T00:00:00.000Z","formattedDate":"3. Juni 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Einzelanmelung voll","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Radstrecken-Checks f\xfcr den Heidelbergman Triathlon","permalink":"/blog/2024/06/04/"},"nextItem":{"title":"Heidelberger Dankeschein","permalink":"/blog/2024/02/11/"}},"content":"![Staffel](/img/banner/Ergebnisse.png)\\n\\n\ud83e\udd73 WIR SIND VOLL! \ud83e\udd73\\n\\n\ud83d\udcaa\ud83c\udffb Alle Einzelstartpl\xe4tze sind vergeben, aber ihr k\xf6nnt euch immer noch mit eurer Familie oder Freunden f\xfcr eine Staffel anmelden. \ud83c\udfca\ud83c\udffb\ud83d\udeb4\ud83c\udffd\u200d\u2642\ufe0f\ud83c\udfc3\ud83c\udffc\u200d\u2640\ufe0f\\nUnsere Vorfreude auf das Event steigt mit jedem Tag und wir freuen uns, dass ihr dabei seid!!\u26a1\ud83c\udf89\ud83c\udfc1\\n\\n\ud83d\udd25RACE DAY: 28.07.2024 \ud83d\udd25 \\n\\n\ud83d\udccdHeidelberg \\n\\n\ud83d\ude80Feiert mit uns das 30. JUBIL\xc4UM\ud83d\ude80"},{"id":"/2024/02/11/","metadata":{"permalink":"/blog/2024/02/11/","source":"@site/blog/2024-02-11.md","title":"Heidelberger Dankeschein","description":"Staffel","date":"2024-02-11T00:00:00.000Z","formattedDate":"11. Februar 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Heidelberger Dankeschein","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Einzelanmelung voll","permalink":"/blog/2024/06/03/"},"nextItem":{"title":"Staffelb\xf6rse","permalink":"/blog/2024/02/06/Staffelboerse"}},"content":"![Staffel](/img/banner/RundUm.jpeg)\\n\\n\ud83d\udd25Heidelberger Dankeschein\ud83d\udd25\\n\\nWir wollen uns bei allen Frauen f\xfcr die Teilnahme am Instagram & Facebook Gewinnspiel bedanken! \ud83e\udef6\ud83c\udffc Leider kann nur EINE von euch gewinnen. Wir haben dennoch eine kleines Angebot f\xfcr die Nicht-Gewinnerinnen. \ud83e\udd17 \\n\\nDank @vielmehr.heidelberg k\xf6nnen wir den n\xe4chsten 10 Einzelstarterinnen nach deren Anmeldung einen 10 \u20ac Heidelberger Dankeschein schenken! \ud83c\udf81\\n\\nMit dem Heidelberger Dankeschein kannst du in \xfcber 165 Akzeptanzstellen nach Herzenslust shoppen, schlemmen oder dich verw\xf6hnen lassen und so gleichzeitig die lokalen Gesch\xe4fte in Heidelberg unterst\xfctzen. Perfekt, um den Start beim HDman mit einem Wochenende in Heidelberg zu verbinden! \ud83d\ude0d\\n\\nWir hoffen viele von euch an der Startlinie zu treffen! \ud83d\udc4b\ud83c\udffc\\n\\nDie 10 Gewinnerinnen der Dankescheine werden n\xe4chste Woche via Mail kontaktiert. \ud83d\udce7\\n\\n\ud83d\udd25RACE DAY: 28.07.2024\ud83d\udd25 \\n\ud83d\udccdHeidelberg \\n\\n\ud83d\ude80Feiert mit uns das 30. JUBIL\xc4UM\ud83d\ude80"},{"id":"/2024/02/06/Staffelboerse","metadata":{"permalink":"/blog/2024/02/06/Staffelboerse","source":"@site/blog/2024-02-06-Staffelboerse.md","title":"Staffelb\xf6rse","description":"Staffel","date":"2024-02-06T00:00:00.000Z","formattedDate":"6. Februar 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Staffelb\xf6rse","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Heidelberger Dankeschein","permalink":"/blog/2024/02/11/"},"nextItem":{"title":"Die Anmeldung ist er\xf6ffnet","permalink":"/blog/2024/01/02/Offen"}},"content":"![Staffel](/img/banner/Staffel.jpg)\\n\\nLiebe Triathlet\\\\*innen und Fans des HeidelbergMan,\\n\\nSeid ihr neu im Triathlon und wollt euch erstmal an einer Staffel versuchen \ud83d\ude80? Oder seid ihr schon erfahrene Triathleten und wollt euch mit anderen messen \ud83d\udca5? Oder habt ihr einfach keine Lust auf alle drei Disziplinen \ud83d\udec1  \ud83d\udef5 \ud83d\udc60? \\n \\nWollt ihr eine Staffel machen, aber euch fehlt noch ein Team? Oder seid ihr auf der Suche nach einem Teammitglied? Dann seid ihr hier genau richtig! \\n\\nSchaut vorbei auf unserer [Staffelb\xf6rse](https://www.heidelbergman.de/Allgemeines/Staffelboerse/) und findet euer passendes Team!\\n\\nWir w\xfcnschen euch viel Erfolg bei der Suche und freuen uns, euch beim HeidelbergMan begr\xfc\xdfen zu d\xfcrfen! \ud83d\ude04"},{"id":"/2024/01/02/Offen","metadata":{"permalink":"/blog/2024/01/02/Offen","source":"@site/blog/2024-01-02-Offen.md","title":"Die Anmeldung ist er\xf6ffnet","description":"Liebe Triathlet\\\\*innen und Fans des HeidelbergMan,","date":"2024-01-02T00:00:00.000Z","formattedDate":"2. Januar 2024","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Die Anmeldung ist er\xf6ffnet","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Staffelb\xf6rse","permalink":"/blog/2024/02/06/Staffelboerse"},"nextItem":{"title":"Die Anmeldung \xf6ffnet am 1. Januar 2024","permalink":"/blog/2023/12/23/Anmeldung"}},"content":"Liebe Triathlet\\\\*innen und Fans des HeidelbergMan,\\n\\ndie Anmeldung f\xfcr den HeidelbergMan 2024 ist er\xf6ffnet. Sicher dir jetzt deinen Startplatz f\xfcr den HeidelbergMan 2024 am 28. Juli 2024.\\n\\nDie Startgeb\xfcren sind wie folgt:\\n\\n| Alle Teilnehmer\\\\*innen (alle Disziplinen insgesamt) |          |            |           |             |\\n| --------------------------------------------------- | -------- | ---------- | --------- | ----------- |\\n| Teilnehmer:in                                       | Einzel   | Einzel U25 | Staffel   | Staffel U25 |\\n| ~~1-200~~ (SOLD OUT)                                | ~~99 \u20ac~~ | ~~69 \u20ac~~   | ~~119 \u20ac~~ | ~~89 \u20ac~~    |\\n| ~~201-400~~ (SOLD OUT)                              |  ~~109 \u20ac~~    | ~~79 \u20ac~~       | ~~129 \u20ac~~     | ~~99 \u20ac~~        |\\n| ab 401                                              | 119 \u20ac    | 89 \u20ac       | 139 \u20ac     | 109 \u20ac       |\\n| Nachmeldung vor Ort                                 | 130 \u20ac    | 130 \u20ac      | 150 \u20ac     | 150 \u20ac       |\\n\\nDie Anmeldung findet ihr [hier](https://heidelbergman2024.racepedia.de/).\\nDie Ausschreibung findet ihr [hier](https://www.heidelbergman.de/Wettkampf/Ausschreibung/).\\n\\nWir freuen uns sehr, dass wir die Veranstaltung wieder aufleben lassen k\xf6nnen und hoffen, dass wir euch alle wiedersehen werden."},{"id":"/2023/12/23/Anmeldung","metadata":{"permalink":"/blog/2023/12/23/Anmeldung","source":"@site/blog/2023-12-23-Anmeldung.md","title":"Die Anmeldung \xf6ffnet am 1. Januar 2024","description":"Liebe Triathlet\\\\*innen und Fans des HeidelbergMan,","date":"2023-12-23T00:00:00.000Z","formattedDate":"23. Dezember 2023","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Die Anmeldung \xf6ffnet am 1. Januar 2024","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Die Anmeldung ist er\xf6ffnet","permalink":"/blog/2024/01/02/Offen"},"nextItem":{"title":"Der HEIDELBERGMAN 2024 findet statt!","permalink":"/blog/2023/12/07/Back"}},"content":"Liebe Triathlet\\\\*innen und Fans des HeidelbergMan,\\n\\nDie Anmeldung f\xfcr den HeidelbergMan 2024 wird am 1. Januar 2024 um 12 Uhr mittags \xf6ffnen. Wir freuen uns sehr, dass wir die Veranstaltung wieder aufleben lassen k\xf6nnen und hoffen, dass wir euch alle wiedersehen werden.\\nMehr Infos zur Veranstaltung findet in der [Ausschreibung](https://www.heidelbergman.de/Wettkampf/Ausschreibung/)."},{"id":"/2023/12/07/Back","metadata":{"permalink":"/blog/2023/12/07/Back","source":"@site/blog/2023-12-07-Back.md","title":"Der HEIDELBERGMAN 2024 findet statt!","description":"Liebe Triathlet\\\\*innen und Fans des HeidelbergMan,","date":"2023-12-07T00:00:00.000Z","formattedDate":"7. Dezember 2023","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelbergman Orga Team","imageURL":"https://www.heidelbergman.de/img/logo/HD_logo10c.png","key":"orga"}],"frontMatter":{"title":"Der HEIDELBERGMAN 2024 findet statt!","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Die Anmeldung \xf6ffnet am 1. Januar 2024","permalink":"/blog/2023/12/23/Anmeldung"}},"content":"Liebe Triathlet\\\\*innen und Fans des HeidelbergMan,\\n\\nIm Jahr 2024 wird der HeidelbergMan Triathlon am 28. Juli 2024 wieder stattfinden. Wir freuen uns sehr, dass wir die Veranstaltung wieder aufleben lassen k\xf6nnen und hoffen, dass wir euch alle wiedersehen werden. Wir werden euch auf dem Laufenden halten, sobald wir weitere Informationen haben.\\n\\nBis dahin, wir halten euch auf dem Laufenden!"}]}')}}]);